sources.styles/utils/_grid.scss:
.grid {
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  column-gap: 20px;

  @include onTablet {
    grid-template-columns: repeat(6, 1fr);
    column-gap: 24px;
  }

  @include onDesktop {
    grid-template-columns: repeat(12, 1fr);
    column-gap: 24px;
  }

  &--desktop {
    display: block;

    @include onTablet {
      display: grid;
    }

    @include onDesktop {
      display: grid;
    }
  }

  &__item {
    @for $start from 1 through 12 {
      @for $end from $start through 12 {

        &--tablet-#{$start}-#{$end} {
          @include onTablet {
            grid-column: #{$start} / #{$end + 1};
          }
        }

        &--desktop-#{$start}-#{$end} {
          @include onDesktop {
            grid-column: #{$start} / #{$end + 1};
          }
        }
      }
    }
  }
}

sources.styles/blocks/page.scss:
.page{
  font-family: 'Inter Tight', sans-serif;
  font-weight: 400;
  font-size: 16px;
  line-height: 27px;
  color: #292929;
  scroll-behavior: smooth;

  &__body {
    margin: 0;
    padding: 0;

    &--with-menu {
      overflow: hidden;
    }
  }

  &__menu {
    height: 100vh;
    position: fixed;
    top: 0;
    left: 0;
    right: 0;
    transform: translateX(100%);
    padding-top: 40px;

    @include onTablet {
      padding-top: 52px;
    }

    &:target {
      transform: translateX(0);
    }
  }

  &__section {
    margin-bottom: 120px;
  }

  &__section-title {
    text-align: center;
    font-weight: 700;
    font-size: 32px;
    line-height: 32px;
    letter-spacing: -1.5px;
    margin: 0 0 64px;

    @include onTablet {
      font-size: 40px;
      line-height: 40px;
    }

    @include onTablet {
      font-size: 48px;
      line-height: 48px;
    }

    &--testimonials {
      text-align: left;
      width: 288px;
      margin: 0 auto 32px;

      @include onTablet {
        width: 411px;
        margin: 0;
      }
    }
  }

  &__footer {
    height: 200px;
    background-image: url(/images/footer-bg.jpg);
    background-size: cover;
    background-position: center;

    @include onTablet {
      height: 400px;
    }

    @include onDesktop {
      height: 460px;
    }
  }
}

sources.styles/blocks/icons.scss:
.icon {
  position: relative;
  display: block;
  width: 24px;
  height: 24px;
  background-position: center;
  background-size: contain;

  @include onTablet {
    width: 32px;
    height: 32px;
  }

  &__tooltip {
    position: absolute;
    right: 100%;
    top: 50%;
    transform: translateY(-50%);

    display: block;
    width: max-content;
    padding-right: 20px;

    letter-spacing: 2px;
    font-weight: 700;
    font-size: 12px;
    line-height: 16px;
    color: #292929;
    opacity: 0;
    pointer-events: none;
  }

  &:hover &__tooltip {
    opacity: 1;
    pointer-events: all;
  }

  &--call {
    background-image: url(/images/icons/Phone-call.png);
  }

  &--menu {
    background-image: url(/images/icons/Burger-menu.png);

    &:hover {
      @include onDesktop {
        background-image: url(/images/icons/Burger-menu-hover.png);
      }
    }
  }

  &--close {
    background-image: url(/images/icons/Close.png);
  }
}

