sources.styles/blocks/header.scss:
.header {
  background-image: url(/images/header/header-bg.jpg);
  background-size: cover;
  background-position: center;
  height: 100vh;
  padding-top: 40px;

  @include onDesktop {
    padding-top: 52px;
  }

  @include onTablet {
    padding-top: 52px;
  }

  &__top {
    display: flex;
    justify-content: space-between;
    align-items: center;
  }

  &__logo-img {
    display: block;
    width: 130px;
    height: 17px;

    @include onTablet {
      width: 190px;
      height: 24px;
    }
  }

  &__nav {
    display: flex;
    gap: 24px;

    @include onTablet {
      gap: 32px;
    }
  }

  &__title-box {
    position: absolute;
    bottom: 7%;
  }

  &__title-img {
    background-image: url(/images/header/Vector.png);
    width: 32px;
    height: 27px;
    background-position: center;
    background-size: contain;

    @include onTablet {
    background-image: url(/images/header/Sound-waves.png);
    width: 63px;
    height: 76px;
    }
  }

  &__title {
    font-family: 'Inter';
    font-style: italic;
    font-weight: 800;
    font-size: 32px;
    line-height: 100%;
    align-items: center;
    letter-spacing: -1.5px;

    @include onTablet {
      font-size: 40px;
    }

    @include onDesktop {
      font-size: 48px;
    }
  }
}

sources.styles/blocks/menu.scss:
.menu {
  background-color: #e5e5e5;

  &__top {
    display: flex;
    height: max-content;
    justify-content: space-between;
    margin-bottom: 55px;

    @include onTablet {
      margin-bottom: 80px;
    }
  }

  &__list {
    display: flex;
    flex-direction: column;
    gap: 32px;
    margin: 0 0 40px;
    padding: 0;
  }

  &__link {
    color: $color-title;
    letter-spacing: 2px;
    text-transform: uppercase;
    font-family: 'Inter';
    font-weight: 700;
    font-size: 22px;
    line-height: 22px;
    width: max-content;

    &:hover {
      border-bottom: solid $color-title;
    }
  }

  &__num {
    display: block;
    color: $color-title;
    font-family: 'Inter';
    font-weight: 700;
    font-size: 12px;
    line-height: 27px;

    &--bold {
    font-size: 16px;
    margin-bottom: 16px;
    }

    &--line {
      width: max-content;
      border-bottom: solid $color-title;
    }
  }
}

sources.styles/blocks/recommended.scss:
