sources.styles/blocks/contacts.scss:
.contacts {

  &__input {
    display: block;
    height: 48px;
    width: 100%;
    background-color: #f8f8fa;
    border-radius: 40px;
    border-color: #f8f8fa;
    border-style: solid;
    border-width: 1px;
    color: #292929;
    padding: 14px 16px 14px;
    margin: 0 0 16px;

    &::placeholder {
      font-family: 'Inter';
      font-size: 14px;
      line-height: 20px;
      color: #7e7e83;
    }

    &:hover {
      border-color: #d5d7de;
    }

    &:focus {
      border-color: #292929;
      outline: none;
    }

    &--textarea {
      resize: none;
      height: 148px;
      border-radius: 16px;
      margin-bottom: 32px;
    }
  }

  &__button {
    display: block;
    width: 100%;
    height: 56px;
    border: 3px solid #292929;
    border-radius: 40px;

    font-weight: 700;
    font-size: 16px;
    line-height: 27px;
    color: #292929;
    margin: 0 0 48px;

    @include onTablet {
      margin-bottom: 0;
    }

    &:hover {
      background-color: #292929;
      color: #fff;
    }
  }

  &__info-txt {
    color: #9fadc2;
    font-size: 14px;
    margin: 0 0 8px;
  }

  &__info-link {
    color: #3e3e3e;
    margin: 0 0 24px;

    &:last-child {
      margin: 0;
    }
  }
}
